// CSS import
import styles from '../styles/Header.module.css';

const Header = () => {
  return (
`    <div>
  <div className={styles.header}>
    <div className={styles.logo}></div>
    <p className={styles.myPage}>My Page</p>
    <button>
      <i class="fa-solid fa-magnifying-glass"></i>
    </button>
  </div>
    </div>`
  )
};

export default Header;
